import React from "react";
import { Button } from "@mui/material";

const ScanButton = () => {
  const handleScan = () => {
    console.log("Scanning...");
  };

  return (
    <Button variant="contained" color="primary" onClick={handleScan}>
      Scan
    </Button>
  );
};

export default ScanButton;
